import React,{useState} from 'react'
import { blogs } from './Array';
const Blogs = () =>{
const [card,setCard] = useState(blogs);

    return(
        <div className="blog">
            <div className="container">
                
                <div className="row">
                    <div className="col">
                        <h2 className='heading'>Latest Blogs</h2>
                    </div>
                </div>

                <div className="row">
                    {
                        card.map((blog)=>{
                            const{id,img,title,desc} = blog;
                        })
                    }
                </div>
            </div>
        </div>
    )
}

export default Blogs;
